import React from 'react';

export default class Form extends React.Component {
    state = {
        firstName: '',
        lastName: '',
        userName: '',
        email: '',
        creditCard: ''
    }

    change = (e) => {
        this.setState({
            [e.target.name]: e.target.value
        });
    };

    onSubmit = (e) => {
        e.preventDefault();
        this.props.onSubmit();
        console.log(this.state)
    };

    render() {
        return (
            <form>
                <input name="firstName" placeholder="First name" value={this.state.firstName} onChange={e => this.change(e)}/>
                <br />
                <input name="lastName" placeholder="Last name" value={this.state.lastName} onChange={e => this.change(e)}/>
                <br />
                <input name="userName" placeholder="Username" value={this.state.userName} onChange={e => this.change(e)}/>
                <br />
                <input name="email" placeholder="Email" value={this.state.email} onChange={e => this.change(e)}/>
                <br />
                <input name="creditCard" placeholder="Credit card" value={this.state.creditCard} onChange={e => this.change(e)}/>
                <br />
                <button onClick={e => this.onSubmit(e)}>Submit</button>
            </form>
        );
    }
}
